k the “POS Integrator -> Payment Methods -> PayTR” section to learn your notification address.'=>'Hesap bilgileriniz kaydedildi. POS Entegratör\'ün düzgün çalışabilmesi için ödeme PayTR panelinden veya PayTR ile iletişime geçerek bildirim adresinizi tanımlamanız/tanımlamanız gerekmektedir. Bildirim adresinizi öğrenmek için “POS Entegratör-> Ödeme Yöntemleri -> PayTR” bölümünü kontrol edebilirsiniz.','Your card is closed to e-commerce transactions. Call your bank.'=>'Kartınız e-ticaret işlemlerine kapalı. Bankanızı arayınız.','Your Method Name'=>'Yöntem Adınız','Your permalink cannot be empty.'=>'Kalıcı bağlantınız boş olamaz.','Your suggestions are very valuable to us so that our applications can work better. You can support us to improve our products by giving feedback.'=>'Uygulamalarımızın daha iyi çalışabilmesi için önerileriniz bizim için çok değerlidir. Geri bildirim vererek ürünlerimizi geliştirmemize destek olabilirsiniz.','Your transaction was not completed, please try again.'=>'İşleminiz gerçekleşmemiştir, lütfen tekrar deneyiniz.
